REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (109, 'ruRU', 'Повышение до 110-го уровня', '', 'На пути каждого героя бывают такие моменты, когда ему нужна помощь в преодолении возникшего препятствия, чтобы он смог вновь вернуться к своим приключениям. Благодаря услуге мгновенного повышения уровня персонажа один из ваших персонажей сможет немедленно получить 110-й уровень.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (110, 'ruRU', 'Повышение до 90-го уровня', '', 'На пути каждого героя бывают такие моменты, когда ему нужна помощь в преодолении возникшего препятствия, чтобы он смог вновь вернуться к своим приключениям. Благодаря услуге мгновенного повышения уровня персонажа один из ваших персонажей сможет немедленно получить 90-й уровень.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (111, 'ruRU', 'Смена имени', '', 'Сменить имя персонажа.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (112, 'ruRU', 'Смена фракции', '', 'Сменить фракция персонажа(с Альянса на Орду или наоборот).', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (113, 'ruRU', 'Смена расы', '', 'Сменить расу персонажа(врамках вашей текущей фракции). Включает в себя смену внешности персонажа и возможную смену имени.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (114, 'ruRU', 'Смена внешности', '', 'Изменить внешний вид персонажа(черты лица, цвет кожи, пол, но не расу). Дополнительная функция смена имени включена.', '');
