REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1606, 'ruRU', 'Ресурсы оплота класса 5.000', '', 'Se usa para reclutar tropas, ejecutar misiones e investigar mejoras para tu Sala de orden.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1607, 'ruRU', 'Пробуждающая сущность2.000', '', 'Utilizado por el Arcanomántico Vridiel en Dalaran, sobre las Islas Quebradas, para crear o mejorar objetos legendarios de Legion.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1608, 'ruRU', 'Печать сломанной судьбы x6', '', 'Tuerce el destino para dar la oportunidad de obtener más tesoros de los jefes de banda de Legion y calabozos míticos.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1609, 'ruRU', 'Дымчатый аргунит 2.000', '', 'Este cristal de color opaco es un objeto muy codiciado por los comerciantes etéreos, especialmente el Taumaturgo Vahsreen, que se encuentra a bordo del Vindicaar.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1610, 'ruRU', 'Отголоски битвы 200', '', 'Se utiliza para comprar armaduras de JcJ poderosas. Cuando termina la temporada, esta moneda se convierte en oro.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1611, 'ruRU', 'Осколок Пустоты 5.000', '', 'Un fragmento de vacío cristalizado que la Legión llevó a Azeroth.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1612, 'ruRU', 'Припасы Армии погибели Легиона 1.000', '', 'Se usan para avanzar en la construcción de estructuras valiosas en la Costa Quebrada.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1613, 'ruRU', 'Незрячий глаз 2.000', '', 'Una moneda tosca, hecha a mano. Lleva un símbolo similar al de los Kirin Tor, con una diferencia específica: el ojo está cerrado.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1614, 'ruRU', 'Отголоски торжества x100', '', 'Se utiliza para comprar armaduras de JcJ de élite. Cuando termina la temporada, esta moneda se convierte en oro.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1630, 'ruRU', 'Повышение до 110-го уровня', '', 'На пути каждого героя бывают такие моменты, когда ему нужна помощь в преодолении возникшего препятствия, чтобы он смог вновь вернуться к своим приключениям. Благодаря услуге мгновенного повышения уровня персонажа один из ваших персонажей сможет немедленно получить 110-й уровень.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1631, 'ruRU', 'Смена имени', '', 'Сменить имя персонажа.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1632, 'ruRU', 'Смена фракции', '', 'Сменить фракция персонажа(с Альянса на Орду или наоборот).', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1633, 'ruRU', 'Смена расы', '', 'Сменить расу персонажа(врамках вашей текущей фракции). Включает в себя смену внешности персонажа и возможную смену имени.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1634, 'ruRU', 'Смена внешности', '', 'Изменить внешний вид персонажа(черты лица, цвет кожи, пол, но не расу). Дополнительная функция смена имени включена.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1635, 'ruRU', 'Prefabricado(PvE) nivel 110', '', 'Comprar un jugador prefabricado incluye:\r\n- Abalorios y capas de nivel 840.\r\n- 20.000 monedas de oro.\r\n- Nivel 110 instantáneo.\r\n- Una montura PvP única: Vermis de escarcha de Gladiador colérico.\r\n- 4 Bolsas de 36 Casillas.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1637, 'ruRU', 'Репутации Classic', '', 'Повысить все репутации Classic до Превознесения.', '');
