REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1644, 'ruRU', 'Обновить все подземелья', '', 'Перезапустить все рейды и подземелья для вашего персонажа.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1645, 'ruRU', 'Промо', '', 'Aprendes todas las equitaciones. + Маунт.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1646, 'ruRU', 'Разблокировать облики артефактов', '', 'Разблокировать облики артефактного оружия для всех ваших персонажей учетной записи.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1647, 'ruRU', 'Разблокировать союзную расу: Эльфы Бездны', '', 'Многие пытались обуздать опасную магию Бездны, но для большинства это оканчалось лишь безумием. Аллерия Ветрокрылая твердо намеревается использовать эту силу во благо Азерота - она стала первой смертной, неподвластной влиянию шепота теней. После того как ей удалось спасти группу собратьев, едва не сгинувших в оъятиях тьмы, Аллерия поклялась научить эльфов Бездны держать темную силу под контролемю. Она хочет добиться того, чтобы обретенная мощь служила Альянсу.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1648, 'ruRU', 'Разблокировать союзную расу: Озаренные дренеи', '', 'На протяжении многих тысячелетий армия Света сражалась с полчищами Пылающего Легиона а Круговерти Пустоты. Самые преданные делу дренеи проходили особый ритуал, чтобы стать одним целым с энергией Света и войти в число озаренных. Когда озаренные одержали окончательную победу на Аргусе, у них появилась новая цель: защищать Азерот от любых угроз и помагать Альянсу в противостоянии Орде.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1649, 'ruRU', 'Разблокировать союзную расу: Ночнорожденные', '', 'Эльфы Сурамара провели 10 000 лет под защитой магического барьера, и за это время они стали слишком зависимы от тайной магии Ночного Колодца. Чтобы защитить источник своей силы, лидеры ночнорожденных заключили сделку с Пылающим Легионом, ввергнув свое государство в гражданскую войну. Отвоевав свободу у своих хозяев-демонов, ночнорожденные присоединились к Орде в надежде вновь обрести свое место на Азероте.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1650, 'ruRU', 'Разблокировать союзную расу: Таурены Крутогорья', '', 'Таурены Крутогорья — потомки Хална, храброго героя, прославившегося во время Войны древних. Они почитают духов земли, реки и неба. После вторжения Легиона доверие между племенами было подорвано, но теперь таурены Крутогорья вновь объединили свои силы. Впервые за долгое время они готовы покинуть священную гору и примкнуть к своим родичам из Калимдора. Орда безусловно будет рада принять столь благородных и могучих союзников.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1651, 'ruRU', 'Полеты Дренор и Легион', '', 'Выучить полеты в зонах Дренора и Легиона. + Маунт.', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1652, 'ruRU', 'Poder de Artefacto Rango 1', '', 'Te Agrega 2.2 billones de poder de artefacto a tu arma.\r\n Aumenta el nivel a 52 de tu arma de artefacto. \r\n', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1653, 'ruRU', 'Смена названия гильдии', '', 'Вы должны быть Лидером Гильдии, чтобы купить эту опцию \r\n, иначе вы просто потратите свои очки магазина..', '');
REPLACE INTO `battlepay_display_info_locales` (`Id`, `Locale`, `Name1`, `Name2`, `Name3`, `Name4`) VALUES (1654, 'ruRU', 'Poder de Artefacto Rango 2', '', 'Te Agrega 100 billones de poder de artefacto a tu arma.\r\n', '');
